public void changeDistances(double[] eigenValues) {
    for (int i = 0; i < alphaMatrix.length; i++) {
        for (int j = 0; j < alphaMatrix.length; j++) {
            if (i != j) {
                squareDistanceMatrix[i][j] += getConstant(eigenValues);
            }
        }
    }
}
